e durée limitée qui ne saurait excéder la durée de conservation fixées par la réglementation. Conformément au Règlement n° 2016/679 dit Règlement général sur la protection des données (RGPD), vous disposez  d\'un droit d\'information et d\'accès, de rectification, de limitation et de portabilité des informations vous concernant. Vous pouvez exercer ces droits en écrivant au Délégué à la protection des données de Volkswagen Group France à l\'adresse email suivante : donneespersonnelles@volkswagengroup.fr, ou à l\'adresse postale suivante : Volkswagen Group France Relation Client, 11 avenue de Boursonne, 02600 Villers-Cotterêts, accompagné de tout titre permettant de justifier de votre identité. En cas de litige, vous disposez également du droit d\'introduire une réclamation auprès de l\'autorité administrative indépendante, la CNIL en France. Pour en savoir davantage sur la façon dont nous traitons vos données vous pouvez consulter la politique de confidentialité du site en lien dans le pied de page.',NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-04 11:06:50','2022-04-04 11:06:50'),(13,NULL,'app','tools','gmap_api',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-04 11:07:11','2022-04-04 11:07:11'),(14,1,'app','tools','gmap_api',NULL,'text','AIzaSyCk-Utd-HdvTQHiyuEWRnMaOSXAzcq2',NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-04 11:07:11','2022-07-12 13:15:13'),(15,NULL,'app','theme','default_family',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-15 16:24:25','2022-04-15 16:24:25'),(16,NULL,'app','theme','default_id',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-15 16:24:25','2022-04-15 16:24:25'),(17,NULL,'app','theme','social_twitter_link',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-15 16:24:25','2022-04-15 16:24:25'),(18,NULL,'app','theme','social_google_link',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'2022-04-15 16:24:25','2022-04-15 16:24:25'),(19,NULL,'app','theme','social_instagram_link',NULL,'text',NULL,NULL,NULL,NULL,NULL,NULL,NULL