 - Avec notice de montage détaillée',NULL,NULL,NULL,'fr_FR'),(2032,2032,'Baguette pour hayon chromée pour T-Roc Cabriolet','baguette-pour-hayon-chromee-pour-t-roc-cabriolet-2gc071360','Enjoliveur de seuil de porte d\'origine Volkswagen pour hayon, look chromé\n - Confère une allure élégante et noble au véhicule\n - Se colle facilement et rapidement sur le bord inférieur du hayon\n - Sert de protège-arête\n - Avec notice de montage détaillée',NULL,NULL,NULL,'fr_FR'),(2033,2033,'Barre de toit T-Cross','barre-de-toit-t-cross-2gm071151','Barres de toit pour barres longitudinales intégrées d\'origine Volkswagen\n - Nouveau design plat, aérodynamique\n - Montage simplifié sur les barres de toit\n - entièrement prémonté, sans pièces détachées, une clé dynamométrique n\'est plus nécessaire\n - Nouveau logo Volkswagen compris, un élégant cache effet 3D\n - Testées selon les critères les plus stricts du groupe Volkswagen\n - Testées City Crash Plus\n - Protégées contre le vol\n - Profilé d\'aluminium de la technologie aéronautique, rainure en T comprise\n \n\n Made in EU',NULL,NULL,NULL,'fr_FR'),(2034,2034,'Barre de toit Taigo','barre-de-toit-taigo-2g7071151','es barres de toit pour barres longitudinales intégrées d\'origine Volkswagen constituent la base idéale de tous les systèmes de portage. Ces barres de toit pour barres longitudinales intégrées testées City Crash Plus selon les critères les plus stricts du groupe Volkswagen sont en profilé d\'aluminium de forme aérodynamique et permettent de fixer, par exemple, porte-planches de surf, porte-vélos, porte-skis et snowboards ou bien encore des coffres de toit extrêmement pratiques. Les barres de toit pour barres longitudinales intégrées sont déjà prémontées, et elles se montent aisément et sans problème sur le rail de toit de votre Volkswagen. Elles sont verrouillables et donc parfaitement protégées contre le vol. Le profil aérodynamique à surface structurée facile à monter réduit les bruits du vent. Clé dynamométrique comprise dans la livraison.',NULL,NULL,NULL,'fr_FR'),(2035,2035,'Tapis de coffre rigide','tapis-de-coffre-rigide-2g7061161','Fond de coffre d’origine Volkswagen\n - Pour plancher de chargement variable, position supérieure\n - Protection contre l’humidité et la saleté\n - Sur mesure\n - Lavable et antidérapant\n - Rebord d’env. 4 cm qui empêche les liquides de s’écouler\n - Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2036,2036,'Câble USB-C sur Apple Lightning 70 cm','cable-usb-c-sur-apple-lightning-70-cm-000051446bb','Le câble USB haut de gamme (USB-C sur Apple Lightning) a été spécialement conçu pour connecter un smartphone ou d\'autres appareils mobiles au système d\'infodivertissement de votre Volkswagen. Le design du câble est adapté de manière optimale à l\'intérieur du véhicule. Longueur de câble de 70 cm. Le câble est enveloppé d\'une gaine textile de haute qualité et dotés de connecteurs en métal chromé portant chacun le logo Volkswagen. Ce câble est idéal pour exploiter les fonctions telles que CarPlay dans AppConnect ; la recharge de l\'équipement raccordé est bien sûr également disponible.',NULL,NULL,NULL,'fr_FR'),(2037,2037,'Adaptateur USB-C sur USB-A 30cm','adaptateur-usb-c-sur-usb-a-30-cm-000051446ae','Le câble USB haut de gamme (USB-C sur douille USB-A) a été spécialement conçu pour connecter un smartphone ou d\'autres appareils mobiles au système d\'infodivertissement de votre Volkswagen. Le design du câble est adapté de manière optimale à l\'intérieur du véhicule. Longueur de câble de 30 cm. Le câble est enveloppé d\'une gaine textile de haute qualité et dotés de connecteurs en métal chromé portant chacun le logo Volkswagen. Ce câble est idéal pour l’échange de données, mais aussi pour exploiter les fonctions telles qu’AppConnect ; la recharge de l\'équipement raccordé est bien sûr également disponible.',NULL,NULL,NULL,'fr_FR'),(2038,2038,'Câble USB-C sur USB-C 70 cm','cable-usb-c-sur-usb-c-70-cm-000051446bc','Le câble USB haut de gamme (USB-C