_FR'),(2047,2047,'Prise Domestique','prise-domestique-000054412c','Câble de recharge d’urgence Mode2 (câble de recharge côté infrastructure)\n - 230V/8A/50Hz\n - Permet une recharge sans station de recharge domestique (Wallbox)\n - Connecteur côté véhicule de type 2 / connecteur côté infrastructure pour la prise de courant existante\n - Longueur de 6 m\n - Couleur de câble du raccord côté infrastructure au boîtier électronique de recharge noir\n - Couleur de câble du connecteur côté véhicule de type2 au boîtier électronique de recharge jaune signal\n - Facilement transportable\n - Contenu de la livraison incluant sac de rangement à mousquetons, notice d’utilisation',NULL,NULL,NULL,'fr_FR'),(2048,2048,'Tapis de coffre réversible pour ID.3','tapis-de-coffre-reversible-pour-id-3-10a061210','Tapis de coffre réversible d\'origine Volkswagen avec protection de seuil de coffre\n - Pour plancher de chargement variable, position supérieure\n - Avec protection du seuil de coffre rabattable\n - Parfaitement adapté\n - Réversible\n - Dessus : velours, dessous : nopes en matière plastique\n - Empêche le chargement de glisser\n - Protège le pare-chocs des endommagements',NULL,NULL,NULL,'fr_FR'),(2049,2049,'Tapis de coffre réversible pour Taigo','tapis-de-coffre-reversible-pour-taigo-2g7061210','Tapis de coffre réversible d\'origine Volkswagen avec protection de seuil de coffre\n - Pour plancher de chargement variable, position supérieure\n - Avec protection du seuil de coffre rabattable\n - Parfaitement adapté\n - Réversible\n - Dessus : velours, dessous : nopes en matière plastique\n - Empêche le chargement de glisser\n - Protège le pare-chocs des endommagements',NULL,NULL,NULL,'fr_FR'),(2050,2050,'Tapis de coffre réversible pour Golf SW VIII','tapis-de-coffre-reversible-pour-golf-sw-viii-5h9061210','Tapis de coffre réversible d\'origine Volkswagen avec protection de seuil de coffre\n - Pour plancher de chargement variable, position supérieure\n - Avec protection du seuil de cof