ent d\'origine Volkswagen\n - Films noirs à rayures décoratives argentées\n - Avant et arrière, 4 pièces\n - Mise en valeur optique du véhicule\n - Protège le seuil de porte contre les rayures\n - Films de protection pour seuils de porte sur mesure\n - Facile à coller\n - Avec notice de montage détaillée',NULL,NULL,NULL,'fr_FR'),(2061,2061,'Porte-Vélos pour le dispositif d\'attelage','porte-velos-pour-le-dispositif-dattelage-3c0071105c','Le porte-vélos Compact III d’origine Volkswagen est petit, léger et compact. Il peut transporter jusqu\'à trois vélos. Grâce au système pliable, les feux arrière, les rails pour vélo et le cadre porteur peuvent être complètement escamotés et rangés, notamment dans le coffre. Grâce au nouveau appui sur pédale, il est très simple de le rabattre sur le véhicule, même avec des vélos dessus. Ainsi, le coffre reste accessible. Lorsqu\'on le remonte, il se verrouille automatiquement. Avec sac de transport particulièrement pratique.',NULL,NULL,NULL,'fr_FR'),(2062,2062,'Porte-Vélos pour le dispositif d\'attelage','porte-velos-pour-le-dispositif-dattelage-000071105k','Le porte-vélos Basic pour le transport de deux vélos ou vélos électriques séduit par sa fixation innovante. Le porte-vélos se fixe automatiquement sur la boule d\'attelage grâce à son engagement simple à la verticale avec rabattement consécutif vers le bas. La fermeture brevetée sans levier assure un montage aisé avec un minimum d\'effort. Les écarteurs innovants amovibles équipés d\'un codage antivol rendent le porte-vélos particulièrement convivial. Le support se replie entièrement et facilement pour un encombrement minimal et pour être rangé dans le coffre. Le support ne peut pas être rabattu sur le véhicule. Le support de plaque d’immatriculation d\'origine, avec monogramme Volkswagen, vient compléter le support Basic.',NULL,NULL,NULL,'fr_FR'),(2063,2063,'Porte-Vélos pour le dispositif d\'attelage','porte-velos-pour-le-dispositif-dattelage-000071105j','Le porte-vélos Premium pour le transport de deux vélos ou vélos électriques fascine par sa construction légère intelligente et sa fixation innovante. Le support se fixe automatiquement sur la boule d\'attelage grâce à son engagement simple à la verticale avec rabattement consécutif vers le bas. La nouvelle fermeture brevetée sans levier assure un montage aisé avec un minimum d\'effort. Les entretoises innovantes amovibles équipées d\'une sécurité antivol rendent le porte-vélos particulièrement convivial. Porte-vélos verrouillable en plus sur la boule. Le grand angle de rabattement permet de rabattre le support à l\'aide de la pédale, de sorte que le coffre reste accessible sans problème, même sur les véhicules avec grand capot arrière. Le support se replie entièrement et facilement pour un encombrement minimal, pour être rangé dans le coffre. Sur certains véhicules, le support peut être transporté sans encombrement dans le logement de la roue de secours. Le support de plaque d’immatriculation d\'origine, avec monogramme Volkswagen, vient parfaire le support Premium. Une housse de transport, protégeant le support, ainsi qu\'une rampe de chargement, facilitant le chargement, sont disponibles en option.',NULL,NULL,NULL,'fr_FR'),(2064,2064,'Protection de seuil de coffre effet inox','protection-de-seuil-de-coffre-effet-inox-5na061195c','Protection parfaite\n - Parfaitement adapté\n - Effet inox\n - Protection de pare-chocs\n - Mise en valeur du seuil de chargement\n - Protection contre les rayures\n - Montage facile\n - Protection de seuil de coffre, sans chiffon de nettoyage',NULL,NULL,NULL,'fr_FR'),(2065,2065,'Protection de seuil de coffre','protection-de-seuil-de-coffre-2g0061197a','Film de protection pour seuil de coffre d\'origine Volkswagen\n - Transparent et discret\n - Sur mesure\n - Protège contre les rayures lors du chargement et du déchargement du coffre à bagages\n - Se colle rapidement et facilement',NULL,NULL,NULL,'fr_FR'),(2066,2066,'Protection de seuil de coffre','protection-de-seuil-de-coffre-2g7061197','Film de protection pour seuil de coffre d\'origine Volkswagen\n - Transparent et discret\n - Sur mesure\n - Protège contre les rayures lors du chargement et du déchargement du coffre à bagages\n - Se colle rapidement et facilement',NULL,NULL,NULL,'fr_FR'),(2067,2067,'Protection de seuil de coffre','protection-de-seuil-de-coffre-2gc061197','Film de protection pour seuil de coffre d\'origine Volkswagen\n - Transparent et discret\n - Sur mesure\n - Protège contre les rayures lors du chargement et du déchargement du coffre à bagages\n - Se colle rapidement et facilement',NULL,NULL,NULL,'fr_FR'),(2068,2068,'Protection de seuil de coffre','protection-de-seuil-de-coffre-10a061197','Film de protection pour seuil de coffre d\'origine Volkswagen\n - Transparent et discret\n - Sur mesure\n - Protège contre les rayures lors du chargement et du déchargement du coffre à bagages\n - Se colle rapidement et facilement',NULL,NULL,NULL,'fr_FR'),(2069,2069,'Protection de seuil de coffre effet inox','protection-de-seuil-de-coffre-effet-inox-2g0061195a','Protection de seuil de coffre d’origine Volkswagen\n - Aspect acier inoxydable\n - Parfaitement adapté\n - Protection de pare-chocs\n - Mise en valeur du seuil de chargement\n - Protection contre les rayures\n - Montage facile\n - Fixation avec ruban adhésif préinstallé',NULL,NULL,NULL,'fr_FR'),(2070,2070,'Station de base pour siège coque pour bébés','station-de-base-pour-siege-coque-pour-bebes-11a019907','Flex Base i-SENSE d’origine Volkswagen\n - De la naissance à 83 cm (≈ 15 mois | 13 kg)\n - Homologué selon R129 (i-SIZE) et CCC\n - Confort modulaire : compatible avec le siège pour enfants d’origine Volkswagen : Siège coque pour bébés i-SIZE et siège pour enfants d’origine Volkswagen : Siège coque pour bébés\n - Angle réglable : pour la position la plus sûre et la plus confortable de votre bébé sur des sièges de voiture inclinés\n - Base pivotante : les sièges auto sur la base peuvent être tournés à 90° pour faciliter l’accès et permettre une utilisation dos à la route\n - Le Flex Base i-SENSE d’origine Volkswagen peut être réglé en quatre positions différentes pour que votre enfant puisse toujours voyager en toute sécurité et confort\n - Pied de support intelligent et réglable\n - Barre de support réglable\n - Le système Pivot Link réduit considérablement le risque de blessures à la tête et au cou\n - La fonction pivotante de la base permet de faire pivoter le siège vers la porte du véhicule pour installer et faire sortir votre enfant sans effort.',NULL,NULL,NULL,'fr_FR'),(2071,2071,'Siège enfant Kidfix pour enfants','siege-enfant-kidfix-pour-enfants-11g019906','Siège enfant Kidfix pour enfants de 3,5 à 12 ans/100 à 150 cm, selon la norme CCC\n \n\n Siège pour enfants d’origine Volkswagen : KIDFIX\n - 100 à 150 cm (≈ 3,5 à 12 ans)\n - Approuvé selon CCC\n - Des orifices d’aération placés avec soin assurent une circulation efficace de l’air pour que votre enfant se sente à l’aise à tout moment, même en cas de longs trajets en voiture\n - Le design élancé du siège permet l’installation de trois sièges KIDFIX sur la banquette arrière de nombreux véhicules, tandis que des marquages pratiques permettent de toujours régler l’appuie-tête à la bonne hauteur\n - Assise repensée pour une protection optimale en cas de collision\n - Appuie-tête ergonomique et facile à régler\n - Housse amovible\n - Nos sièges pour enfants avec dossier protègent votre enfant de trois manières : la coque protège votre enfant de la tête aux hanches, en particulier en cas de choc latéral. En même temps, les guides de sangle supérieurs et inférieurs garantissent que la ceinture du véhicule est bien en place et l’appuie-tête rembourré offre sécurité et confort pour la tête et le cou de votre enfant.\n - Le système Secure-guard aide à protéger en particulier la zone abdominale sensible de votre enfant grâce à un 4e point de fixation supplémentaire de la ceinture de sécurité 3 points pour adultes. Grâce au positionnement optimal de la ceinture sous-abdominale sur l’os du bassin de votre enfant, le système Secure-guard réduit les forces qui agissent en cas de collision frontale tout en donnant à votre enfant une liberté de mouvement suffisante pendant la conduite\n - Dossier amovible, un siège enfant avec dossier est l’option la plus sûre pour votre enfant. C’est pourquoi nous vous conseillons de placer votre enfant le plus longtemps possible dans un siège pour enfants avec dossier. Pour plus de flexibilité, vous pouvez retirer complètement le dossier si votre enfant mesure plus de 138 cm',NULL,NULL,NULL,'fr_FR'),(2072,2072,'Siège enfant GTI Kidfix pour enfants','siege-enfant-gti-kidfix-pour-enfants-5hv019906','Siège enfant i-SIZE Kidfix GTI, enfants de 3,5 à 12 ans/100 à 150 cm, selon la norme R129\n \n\n Siège pour enfants d’origine Volkswagen : KIDFIX i-SIZE version GTI\n - 100 à 150 cm (≈ 3,5 à 12 ans)\n - Homologué selon R129 (i-SIZE)\n - Des orifices d’aération placés avec soin assurent une circulation efficace de l’air pour que votre enfant se sente à l’aise à tout moment, même en cas de longs trajets en voiture\n - Le design élancé du siège permet l’installation de trois sièges KIDFIX i-SIZE sur la banquette arrière de nombreux véhicules, tandis que des marquages pratiques permettent de toujours régler l’appuie-tête à la bonne hauteur\n - Assise repensée pour une protection optimale en cas de collision\n - Appuie-tête ergonomique et facile à régler\n - Housse amovible\n - Nos sièges pour enfants avec dossier protègent votre enfant de trois manières : la coque protège votre enfant de la tête aux hanches, en particulier en cas de choc latéral. En même temps, les guides de sangle supérieurs et inférieurs garantissent que la ceinture du véhicule est bien en place et l’appuie-tête rembourré offre sécurité et confort pour la tête et le cou de votre enfant.\n - Le système Secure-guard aide à protéger en particulier la zone abdominale sensible de votre enfant grâce à un 4e point de fixation supplémentaire de la ceinture de sécurité 3 points pour adultes. Grâce au positionnement optimal de la ceinture sous-abdominale sur l’os du bassin de votre enfant, le système Secure-guard réduit les forces qui agissent en cas de collision frontale tout en donnant à votre enfant une liberté de mouvement suffisante pendant la conduite\n - Dossier amovible, un siège enfant avec dossier est l’option la plus sûre pour votre enfant. C’est pourquoi nous vous conseillons de placer votre enfant le plus longtemps possible dans un siège pour enfants avec dossier. Pour plus de flexibilité, vous pouvez retirer complètement le dossier si votre enfant mesure plus de 138 cm',NULL,NULL,NULL,'fr_FR'),(2073,2073,'Siège enfant','siege-enfant-11a019909','Siège enfant i-SIZE Trifix, enfants de 15 à 48 mois/76 à 105 cm/18 kg, selon la norme R129/CCC\n \n\n Siège pour enfants d’origine Volkswagen : TRIFIX i-SIZE\n - 76 à 105 cm (15 mois – 4 ans | 18 kg)\n - Homologué selon R129 (i-SIZE) et CCC\n - Sécurité totale : grâce à une excellente protection latérale « SICT inside » et au système ISOFIX Pivot Link\n - Montage facile grâce à ISOFIX et Top Tether intégrés : pour conserver plus de place pour les jambes\n - Appuie-tête réglable et harnais 5 points : pour plus de sécurité et de confort en déplacement\n - Technologie de protection latérale intégrée (SICT inside)\n - Le système Pivot Link réduit considérablement le risque de blessures à la tête et au cou\n - Ses coutures nouées uniques lui permettent de se déchirer progressivement de manière contrôlée et d’affaiblir les forces exercées en cas de choc frontal\n - Appuie-tête en V spécialement conçu pour garder le contrôle du mouvement de la tête sensible de l’enfant en cas de choc latéral\n - Profondeur, parois latérales avec rembourrage souple\n - Protection anticollision souple spéciale en néoprène\n - Le système de ceinture 5 points protège votre enfant de tous les côtés en cas d’accident\n - Plusieurs réglages des positions de repos\n - Pour que vous puissiez attacher facilement votre enfant dans son siège, la boucle de ceinture reste en position avant.\n - Retrait rapide de la housse',NULL,NULL,NULL,'fr_FR'),(2074,2074,'Siège enfant naissance','siege-enfant-naissance-5g0019909f','Siège pour enfants d’origine Volkswagen : Dualfix\n - Naissance – 18 kg (≈ 4 ans)\n - Approuvé selon CCC\n - Flexibilité totale – face à la route ou dos à la route jusqu’à 4 ans grâce à la fonction de rotation à 360°\n - Dos à la route pour rouler encore plus longtemps en toute sécurité et confort : de la naissance à 4 ans avec un espace supplémentaire pour les jambes grâce à des étriers réglables en toute flexibilité\n - Sécurité totale sans compromis – avec système SICT inside et Pivot Link ISOFIX\n - Barre de support réglable\n - Le système Pivot Link réduit considérablement le risque de blessures à la tête et au cou\n - Plusieurs réglages des positions de repos\n - Profondeur, parois latérales avec rembourrage souple\n - Appuie-tête en V spécialement conçu pour garder le contrôle du mouvement de la tête sensible de l’enfant en cas de choc latéral\n - Protection anticollision souple spéciale en néoprène\n - Le système de ceinture 5 points protège votre enfant de tous les côtés en cas d’accident\n - Pied de support réglable en hauteur\n - Retrait rapide de la housse\n - Insert pour nouveau-né',NULL,NULL,NULL,'fr_FR'),(2075,2075,'Siège enfant','siege-enfant-11g019900','Siège enfant\n \n\n Siège pour enfants d’origine Volkswagen : Siège coque pour bébés\n - De la naissance à 83 cm (≈ 15 mois | 13 kg)\n - Approuvé selon CCC\n - Confort prolongé de la naissance jusqu’à l’âge de 15 mois (83 cm)\n - Technologie brevetée pour une position allongée à plat, pour la sécurité et le confort\n - Installation facile grâce à une rotation à 90 degrés vers la porte de voiture ouverte sur la Flex Base i-SENSE d’origine Volkswagen\n - Compatibilité optimale avec Flex Base i-SENSE d’origine Volkswagen et la plupart des poussettes\n - Le siège pour enfants d’origine Volkswagen : Le siège coque pour bébés i-SIZE s’installe facilement sur la Flex Base i-SENSE d’origine Volkswagen\n - Harnais 5 points\n - Appuie-tête et sangles faciles à régler\n - Retrait rapide de la housse\n - Pare-soleil, avec protection solaire UPF 50+, protège votre enfant non seulement du soleil, mais aussi du vent',NULL,NULL,NULL,'fr_FR'),(2076,2076,'Tapis de coffre','tapis-de-coffre-2g7061160','Tapis de coffre d’origine Volkswagen\n - Pour plancher de chargement variable, position supérieure\n - Protection contre l’humidité et la saleté\n - Antidérapant\n - Enroulable\n - Léger et souple\n - Sur mesure\n - Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2077,2077,'Tapis de coffre','tapis-de-coffre-2g7061160a','Tapis de coffre d’origine Volkswagen\n - Pour plancher de chargement profond\n - Protection contre l’humidité et la saleté\n - Antidérapant\n - Enroulable\n - Léger et souple\n - Sur mesure\n - Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2078,2078,'Tapis de coffre','tapis-de-coffre-10a061160','Tapis de coffre d’origine Volkswagen\n - Pour plancher de chargement variable, position supérieure\n - Protection contre l’humidité et la saleté\n - Antidérapant\n - Enroulable\n - Léger et souple\n - Sur mesure\n - Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2079,2079,'Tapis de coffre','tapis-de-coffre-1s0061160a','Tapis de coffre d’origine Volkswagen\n - Pour plancher de chargement profond\n - Protection contre l’humidité et la saleté\n - Antidérapant\n - Enroulable\n - Léger et souple\n - Sur mesure\n - Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2080,2080,'Tapis de sol Textile','tapis-de-sol-textile-2g1061404a-wgk','Tapis de sol textiles avant et arrière, « Plus », noir, véhicule à direction à gauche\n \n\n Tapis de sol textiles « Plus »\n - Kit de 4 pour l’avant et l’arrière\n - Résistants\n - Sur mesure et antidérapants\n - Protection textile dans la zone des tal