,2108,'Dispositif d\'attelage T-Cross (kit) fixe (Prod avant S30/2020)','dispositif-dattelage-t-cross-kit-fixe-prod-avant-s-302020-2gm092103a','Dispositif d\'attelage T-Cross (kit) fixe (Prod avant S30/2020)',NULL,NULL,NULL,'fr_FR'),(2109,2109,'Dispositif d\'attelage T-Cross (kit) fixe (Prod après S30/2020)','dispositif-dattelage-t-cross-kit-fixe-prod-apres-s-302020-2gm092103b','Dispositif d\'attelage T-Cross (kit) fixe (Prod après S30/2020)',NULL,NULL,NULL,'fr_FR'),(2110,2110,'Attelage pour porte-vélos pour ID.3','attelage-pour-porte-velos-pour-id-3-10a092150a','Attelage pour porte-vélos pour ID.3',NULL,NULL,NULL,'fr_FR'),(2111,2111,'Dispositif d\'attelage (kit) amovible,(avec faisceau 13 broches), seulement','dispositif-dattelage-kit-amovibleavec-faisceau-13-broches-seulement-5h0092150','Dispositif d\'attelage (kit) amovible,(avec faisceau 13 broches), seulement pour véhicules sans prééquipement pour dispositif d\'attelage',NULL,NULL,NULL,'fr_FR'),(2112,2112,'Siège enfant de 9 à 18kg','siege-enfant-de-9-a-18-kg-5h0019909','Le système de siège pour enfants d’origine Volkswagen \"G1 ISOFIX DUO Plus\" offre une protection optimale et un confort maximal pour les enfants de 8 mois à 4 ans environ. Cela correspond à un poids d\'env. 9 à 18 kg. Le siège se bloque avec la fixation « Top Tether » aux fixations « Top Tether » prévues dans le coffre du véhicule - Cela assure une fixation complémentaire. Ce siège peut être utilisé dans tous les véhicules qui ont des points de fixation « Top Tether ». Le harnais est facilement réglable en hauteur. Les housses s\'enlèvent facilement et sont lavables. La coque peut être verrouillée dans 3 positions d’inclinaison différentes.\n Livré avec la sangle pour la fixation Top Tether.',NULL,NULL,NULL,'fr_FR'),(2113,2113,'Siège enfant i-SIZE Kidfix 3 à 12 ans selon la norme R129','siege-enfant-i-size-kidfix-3-a-12-ans-selon-la-norme-r-129-11a019906','Siège pour enfants d’origine Volkswagen : KIDFIX i-SIZE\n - 100 à 150 cm (≈ 3,5 à 12 ans)\n - Homologué selon R129 (i-SIZE)\n - Des orifices d’aération placés avec soin assurent une circulation efficace de l’air pour que votre enfant se sente à l’aise à tout moment, même en cas de longs trajets en voiture\n - Le design élancé du siège permet l’installation de trois sièges KIDFIX i-SIZE sur la banquette arrière de nombreux véhicules, tandis que des marquages pratiques permettent de toujours régler l’appuie-tête à la bonne hauteur\n - Assise repensée pour une protection optimale en cas de collision\n - Appuie-tête ergonomique et facile à régler\n - Housse amovible\n - Nos sièges pour enfants avec dossier protègent votre enfant de trois manières : la coque protège votre enfant de la tête aux hanches, en particulier en cas de choc latéral. En même temps, les guides de sangle supérieurs et inférieurs garantissent que la ceinture du véhicule est bien en place et l’appuie-tête rembourré offre sécurité et confort pour la tête et le cou de votre enfant.\n - Le système Secure-guard aide à protéger en particulier la zone abdominale sensible de votre enfant grâce à un 4e point de fixation supplémentaire de la ceinture de sécurité 3 points pour adultes. Grâce au positionnement optimal de la ceinture sous-abdominale sur l’os du bassin de votre enfant, le système Secure-guard réduit les forces qui agissent en cas de collision frontale tout en donnant à votre enfant une liberté de mouvement suffisante pendant la conduite\n - Dossier amovible, un siège enfant avec dossier est l’option la plus sûre pour votre enfant. C’est pourquoi nous vous conseillons de placer votre enfant le plus longtemps possible dans un siège pour enfants avec dossier. Pour plus de flexibilité, vous pouvez retirer complètement le dossier si votre enfant mesure plus de 138 cm',NULL,NULL,NULL,'fr_FR'),(2114,2114,'Boite pliante pour câble de recharge avec gants et chiffon','boite-pliante-pour-cable-de-recharge-avec-gants-et-chiffon-000054410a','Boîte pliante pour câble de recharge électrique\n Dimensions L-l-H : 40 cm x 37 cm x 15 cm\n Y compris boîte à gants et chiffon dans le filet intérieur\n Bandes velcro pour la fixation du/des câble(s)\n Logo sur le couvercle\n Dessous antidérapant\n Pliable\n Conçu pour insérer/retirer le câble aisément\n Le câble ne « traîne » pas dans le coffre à bagages\n Couleur : noir bordé gris',NULL,NULL,NULL,'fr_FR'),(2115,2115,'Tapis de coffre rigide pour plancher de chargement de base','tapis-de-coffre-rigide-pour-plancher-de-chargement-de-base-11e061161a','Tapis de coffre pour véhicules avec plancher de chargement de base\n\n- Fond de coffre d’origine Volkswagen\n- Pour plancher de chargement profond\n- Protection contre l’humidité et la saleté\n- Sur mesure\n- Lavable et antidérapant\n- Rebord d’env. 4 cm qui empêche les liquides de s’écouler\n- Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2116,2116,'Tapis de  coffre Véhicules avec plancher de chargement de base','tapis-de-coffre-vehicules-avec-plancher-de-chargement-de-base-11e061160a','Tapis de coffre souple pour véhicules avec plancher de chargement de base\n- Tapis de coffre d’origine Volkswagen\n- Pour plancher de chargement profond\n- Protection contre l’humidité et la saleté\n- Antidérapant\n- Enroulable\n- Léger et souple\n- Sur mesure\n- Avec monogramme du véhicule',NULL,NULL,NULL,'fr_FR'),(2117,2117,'Seuils de porte pour ARTEON','seuils-de-porte-pour-arteon-3g8071310-zmd','Ajoutez de l\'élégance à votre Volkwagen avec ces seuils de porte pour ARTEON. Ce kit en aluminium contient 2 unités. Emplacement : Portes avant et arrière Couleur : Noir à bandes argent',NULL,NULL,NULL,'fr_FR'),(2118,2118,'Jeu de 4 tapis caoutchouc Premium pour Arteon','jeu-de-4-tapis-caoutchouc-premium-pour-arteon-3g8061500-82v','Protégez l\'habitacle de votre Volkswagen avec ce jeu de 4 tapis (avant et arrière) en caoutchouc, résistants et sur mesure, siglés Arteon. Jeu de 4 tapis avant/arrière. Matière : caoutchouc Couleur : noir Design : avec inscription Mode de fixation : système de