gement et transport Branchement : prise courant 12V dans l\'habitacle Couleur : noir Le véhicule doit être équipé d\'une prise 12V Véhicule doit être équipé d\'une prise 12V',NULL,NULL,NULL,'fr_FR'),(2195,2195,'Porte-skis et snowboards - jusqu\'à 4 paires de ski ou 2 snowboards','porte-skis-et-snowboards-jusqua-4-paires-de-ski-ou-2-snowboards-000071129m','Grâce au porte-skis et snowboards Basic d’origine Volkswagen, vous pouvez aisément transporter jusqu’à 4 paires de skis ou 2 snowboards sur le toit de votre véhicule et ce, en toute sécurité.  Le porte-skis et snowboards se monte facilement sur les barres de toit (fixation à rainure en T) et est verrouillable. Touche d’ouverture large utilisable même avec de gros gants. Les skis et snowboards sont maintenus entre deux profilés en caoutchouc souple. Le porte-skis a été testé City Crash. Poids : 3 kg Charge admissible : 24 kg Capacité : jusqu\'à 4 paires de ski ou 2 snowboards Matière : caoutchouc  Couleur : noir / argent Largeur support : 44 cm Nécessite l\'utilisation de barres de toit',NULL,NULL,NULL,'fr_FR'),(2196,2196,'Porte-skis et snowboards - jusqu\'à 6 paires de ski ou 4 snowboards','porte-skis-et-snowboards-jusqua-6-paires-de-ski-ou-4-snowboards-000071129n','Transportez aisément jusqu\'à 4 paires de skis paraboliques grâce à ce porte-ski équipé d\'un bouton d\'ouverture facile. Poids : 4 kg Charge admissible : 36 kg Capacité : jusqu\'à 4 paires de skis paraboliques Matière : caoutchouc  Couleur : noir / argent Largeur support : 64 cm Nécessite l\'utilisation de barres de toit',NULL,NULL,NULL,'fr_FR'),(2197,2197,'Bouchons de valves Volkswagen','bouchons-de-valves-volkswagen-71215','Personnalisez dans les moindres détails votre voiture grâce à ces 4 bouchons de valve au logo Volkswagen. Matière : laiton nickelé Couleur : argent',NULL,NULL,NULL,'fr_FR'),(2198,2198,'Housse de roues pour les roues jusqu\'à 18\'\'','housse-de-roues-pour-les-roues-jusqua-18-73900','Protégez vos pneus lorsque vous les transportez o