te, support Apple iPad pour iPad 2-4 et iPad-Air, et support pour Samsung Galaxy Tab 3/4 10.1 Incompatible avec Up! ou sièges sport',NULL,NULL,NULL,'fr_FR'),(2262,2262,'Support de tablette pour Samsung Galaxy Tab 3/4','support-de-tablette-pour-samsung-galaxy-tab-34-000061125d','Rendez plus agréables vos voyages avec un support de tablette pour Samsung Galaxy Tab 3/4 (Support de voyages multifonction). Système à clip Le support de base peut être utilisé avec les adaptateurs suivants : crochet universel, cintre, table pliante, Apple iPad 2-4, support mini iPad et iPad Air Incompatible avec Up! ou sièges sport',NULL,NULL,NULL,'fr_FR'),(2263,2263,'Protection de seuil de chargement transparent ARTEON','protection-de-seuil-de-chargement-transparent-arteon-3g8061197','Protégez des rayures le seuil de chargement de votre Volkswagen grâce au film de protection entièrement transparent.',NULL,NULL,NULL,'fr_FR'),(2264,2264,'Film de protection de seuil de chargement transparent pour GOLF','film-de-protection-de-seuil-de-chargement-transparent-pour-golf-5g0061197b','Protégez des rayures le seuil de chargement de votre Volkswagen grâce au film de protection entièrement transparent. Couleur : Transparent',NULL,NULL,NULL,'fr_FR'),(2265,2265,'Tapis de coffre rigide pour Golf VIII','tapis-de-coffre-rigide-pour-golf-viii-5h0061161','Préservez la propreté de votre coffre à l’aide de ce tapis en polyéthylène imperméable, antidérapant, résistant et lavable. Couleur : Noir  Matière : Polyéthylène (PE)  Hauteur : 50 mm',NULL,NULL,NULL,'fr_FR'),(2266,2266,'Tapis de sol Textile','tapis-de-sol-textile-5h1061270-wgk','- Tapis de sol d\'origine Volkswagen\n - Kit de 4 pour l’avant et l’arrière\n - Avec monogramme du véhicule\n - Sur mesure et durables\n - Résistants\n - Inodores\n - Adaptés au système de fixation Volkswagen',NULL,NULL,NULL,'fr_FR'),(2267,2267,'Barres de toit pour Golf VIII','barres-de-toit-pour-golf-viii-5h4071126','Augmentez vos capacités de transport en y apposant un coffre de toit, un porte-skis ou un porte-vélos ; En aluminium, solides et légères, elles s’installent facilement sur votre VOLKSWAGEN.  Matériaux : aluminium  Poids : 4,5 kg  Charge admissible : 50 kg',NULL,NULL,NULL,'fr_FR'),(2268,2268,'Tapis de sol Textile','tapis-de-sol-textile-5h1061445-wgk','Tapis de sol textiles Avant et arrière, pas pour semi-hybride, noir, Optimat\n \n\n - Tapis de sol textiles d’origine Volkswagen « Optimat »\n - Kit de 4 pour l’avant et l’arrière\n - Avec monogramme du véhicule\n - Sur mesure et antidérapants\n - Résistants\n - Tapis de sol textiles avec fonctionnalité de tapis de sol en caoutchouc\n - Adaptés au système de fixation Volkswagen',NULL,NULL,NULL,'fr_FR'),(2269,2269,'Table pliante avec porte-gobelet','table-pliante-avec-porte-gobelet-000061124','Optez pour une table pliante avec porte-gobelet pour rendre plus agréables vos voyages (Support de voyages multifonction). Système à clip Support de base peut être utilisé avec les adaptateurs suivants : crochet universel, cintre, support Apple iPad 2-4, iPad mini et iPad-Air, et support pour Samsung Galaxy Tab 3/4 10.1 Incompatible avec Up! ou sièges sport',NULL,NULL,NULL,'fr_FR'),(2270,2270,'Housse de roues pour les roues jusqu\'à 18\'\'','housse-de-roues-pour-les-roues-jusqua-18-000073900','Protégez vos pneus lorsque vous les transportez ou les stockez avec la housse Volkswagen pour des roues jusqu\'à 18\'\'. Le lot de quatre housses de pneus des Accessoires d’Origine Volkswagen vous permet de prendre soin de vos roues lorsque vous les transportez et de préserver leur valeur en cas de stockage dans un garage ou dans une cave. Fabriquées en polyester de qualité supérieure, ces housses sont très résistantes. Elles sont munies d’une solide poignée, de poches extérieures pour ranger les boulons et d’un symbole permettant d’identifier aisément les différentes roues. 1 jeu de 4 unités. Matière : polyester  Couleur : noir / bleu Dimensions : jusqu\'à 18\"',NULL,NULL,NULL,'fr_FR'),(2271,2271,'Poubelle pour porte-gobelet','poubelle-pour-porte-gobelet-000061142','La boîte à ordures d\'origine Volkswagen est la propreté avant tout. La boîte à ordures se pose facilement dans le porte-gobelet entre les sièges avant, et s\'enlève aussi facilement si nécessaire. La boîte rend les longs voyages agréables, ainsi que les voyages avec les enfants, et la voiture reste propre.',NULL,NULL,NULL,'fr_FR'),(2272,2272,'Système modulaire de voyage & confort','systeme-modulaire-de-voyage-confort-000061122','Le système modulaire de voyage & confort offre de nombreuses possibilités pour simplifier et rendre plus agréables les voyages. Avec l\'adaptateur adapté des Accessoires Volkswagen, tout peut être fixé sur le support de base.\nLe support de base peut être utilisé avec les adaptateurs suivants :\ncrochet universel, cintre, table pliante, support Apple iPad pour iPad 2-4, iPad mini et iPad-Air, et support pour Samsung Galaxy Tab 3/4 10.1\nLa fixation du support de base se fait par un assemblage vissé simple entre les traverses des appuie-têtes.',NULL,NULL,NULL,'fr_FR'),(2273,2273,'Repousse-martre ultrasons','repousse-martre-ultrasons-000054651a','Les avantages\n IP65 :\n Avec l’indice de protection IP 65 (résistant à l’eau et à la saleté) l’appareil M2700 peut être monté directement sur les ouvertures d’accès des animaux dans le compartiment-moteur.\n 360° :\n Grâce à un capteur de contact acoustique à ultrasons directement couplé, la surface bombée du boîtier est soumise à des vibrations pour atteindre un rayon d’action de 360° ! Cette méthode a été utilisée jusqu’à présent, entre autres pour les sous-marins (sonar), mais elle est tout à fait nouvelle dans le domaine des dispositifs antirongeurs. Les ultrasons se propagent vers l’avant comme la lumière : ils sont à peine perceptibles derrière des obstacles ou sur les côtés. Avec le M2700, les ondes sonores sont désormais émises de tous les côtés pour offrir une protection complète contre les rongeurs.\n Sons sinusoïdaux agressifs :\n Le M2700 produit des ultrasons sinusoïdaux intermittents très intenses. Ces sons agressifs sont similaires aux cris d’alerte et d’anxiété naturels des animaux sauvages et sont perçus extrêmement gênants pour les rongeurs, qui les évitent autant que possible. Les sons sont émis avec un changement d’amplitude afin que les animaux ne s’y habituent pas. De plus, la technologie intermittente appliquée permet une consommation d’énergie extrêmement faible (inférieure à 2 mA).\n •Fonctionnement véhicule à l’arrêt\n •Affichage du fonctionnement avec DEL clignotante\n •Pression acoustique élevée\n •Caractères e1\n •Distribué par Volkswagen accessoires',NULL,NULL,NULL,'fr_FR'),(2274,2274,'Dispositif conçu pour éviter les empreintes d\'animaux sur la carrosserie','dispositif-concu-pour-eviter-les-empreintes-danimaux-sur-la-carrosserie-000054650h','Dispositif antirongeur M7500\n DISPOSITIF ANTIRONGEUR\n A ULTRASONS A DEUX COTES, repousse vers l’intérieur et l’extérieur.\n Le capot moteur, le toit de la voiture ou le capot de coffre émet des ultrasons désagréables pour les rongeurs et les chats. L’oscillateur est collé sous la tôle et l’utilise comme corps de résonance, de sorte que de puissants ultrasons intermittents agressifs sont diffusés vers le haut et vers le bas. Cela permet d’empêcher les animaux de marcher sur la voiture ou de s’y installer (rayures sur la peinture, excréments). L’avantage particulier par rapport aux dispositifs antirongeurs classiques avec haut-parleurs montés dans le compartiment moteur est que cet appareil diffuse aussi bien dans le compartiment moteur que vers l’extérieur.\n •Distribué par Volkswagen accessoires',NULL,NULL,NULL,'fr_FR'),(2275,2275,'Repousse-martre combiné ultrasons et haute tension','repousse-martre-combine-ultrasons-et-haute-tension-000054650j','M4700B\n 6 brosses multi-contacts haute tension\n Pour les plaques traditionnelles, il est nécessaire que le rongeur les touche avec le museau ou les pattes, alors que le pelage isole et protège l’animal. Les brosses multi-contacts traversent maintenant le pelage et élargissent considérablement la « surface d’attaque ». De plus, ces brosses et un haut-parleur 100 % étanche permettent un montage dans n’importe quel environnement, même aux endroits les plus profonds. Avec « Softstart » (convient pour hybride, BMS, etc.). Montage rapide (pas de « borne 15 » nécessaire), faible consommation de courant, plus contrôleur de batterie. Compatible avec le lavage du moteur.\n Sons sinusoïdaux agressifs (non audibles par l’homme) intermittents sans effet d’habitude\n Pression acoustique élevée\n Démarrage et arrêt automatiques plus interrupteur du capot-moteur de sécurité\n Compatible bus CAN et hybride\n Connecteur compact étanche pour faciliter le remplacement\n Caractère e1\n Plastique auto-extinguible\n •Distribué par Volkswagen accessoires',NULL,NULL,NULL,'fr_FR'),(2276,2276,'Repousse-martre combiné ultrasons et haute tension (à pile)','repousse-martre-combine-ultrasons-et-haute-tension-a-pile-000054650k','Dispositif antirongeurs M9700\n COMBINE D’INSTRUMENTS\n Haute tension. Près de la peau !\n Brosses haute tension multi-contacts coulissantes, étanches, fonctionnement sur batterie avec indicateur de batterie faible\n Le M9700 fonctionne sur batterie et produit des chocs électriques sur le rongeur lorsqu’il touche l’une des 6 brosses haute tension multi-contacts dans le compartiment moteur (impulsions de courant qui chassent le rongeur ne le tuent pas). Les nouvelles brosses haute tension multi-contacts passent à travers le pelage et, outre les pattes et le museau, la surface d’effet est élargie à la peau et donc considérablement augmentée. Les brosses haute tension multi-contacts peuvent être placées n’importe où, ce qui permet d’obtenir une protection flexible adaptée au véhicule. En séparant le calculateur (visible en haut) de l’émetteur d’ultrasons (rayonnement libre en bas), il est possible de réaliser un montage stratégique. L’émetteur d’ultrasons produit de très puissants ultrasons intermittents agressifs sur un rayon de 360°. Ces sons varient de manière aléatoire en fréquence et en cadence pour éviter que les rongeurs s’y habituent. L’étanchéité à l’eau permet un montage plus profond aux points d’entrée. Utilisation sur batterie sans danger avec indicateur de batterie faible et protection contre le courant réactif. Si nécessaire, l’appareil peut être complété par 4 brosses haute tension multi-contacts (accessoires).\n •Distribué par Volkswagen accessoires',NULL,NULL,NULL,'fr_FR'),(2277,2277,'Spray repousse-martres','spray-repousse-martres-000054780','Dispositif antirongeur\n\n- L\'agent actif naturel et thermorésistant est tout simplement vaporisé dans le compartiment moteur\n- Également utilisable dans des greniers\n- Recommandé par les vétérinaires\nUtiliser le spray de protection contre les martres en toute sécurité. Toujours lire les étiquettes et informations produit avant l\'utilisation.',NULL,NULL,NULL,'fr_FR'),(2278,2278,'Repousse-martre ultrasons (à pile)','repousse-martre-ultrasons-a-pile-000054650e','Dispositif antirongeur\n \n\n -Étanche selon la classe de protection IP65\n -Fonctionne avec 2 piles AA 1,5 V (non fournies)\n -Aucun raccordement nécessaire, convient donc parfaitement pour les carports, le compartiment moteur, le grenier, les caravanes, l’hivernage, etc.\n -Système électronique moulé et boîtier complètement fermé\n -Durée de vie jusqu’à 12 mois selon la qualité des piles\n -Affichage du fonctionnement par DEL clignotante\n -Les rongeurs sont sensibles aux sons et les fuient\n -Les sons sont intermittents (activés et désactivés), donc pas d’effet d’habitude\n -Véritables ultrasons sinusoïdaux ? non audibles pour les humains, à 23 kHz, mais une gêne importante pour les animaux sauvages\n -Grâce à la technologie d’impulsions appliquée, très faible consommation d’énergie\n Avant utilisation :\n •Les rongeurs défendent souvent leur territoire en cas d’abroutissement, en particulier lorsque d’autres marques olfactives de rongeurs ont été placées. C’est pourquoi il est impératif de nettoyer le moteur avant toute utilisation. Le cas échéant, nettoyer aussi l’emplacement avec une brosse et du liquide vaisselle.\n Caractéristiques techniques :\n -Fréquence des ultrasons : env. 23 KHz (+/- 10 %), sinusoïdaux, intermittents\n -Angle de diffusion : env. 180 degrés\n -Pression acoustique : env. 105 dB (+/- 15 %)\n -Consommation de courant : env. 0,33 mA en moyenne\n -Affichage du fonctionnement : DEL clignotante de 5 mm\n -Piles : 2 piles AA 1,5 V (pas de batterie 1,2 V)\n -Portée : env. 6 m (env. 60 m²)\n •Distribué par Volkswagen accessoires',NULL,NULL,NULL,'fr_FR'),(2279,2279,'Coffre de toit Basic 340L Volkswagen','coffre-de-toit-basic-340-l-volkswagen-000071200','Le coffre de toit Basic 340 proposé par Volkswagen avec un volume d\'env. 340 litres a une forme aérodynamique optimisée, qui réduit énormément les bruits désagréables du vent. Il est adapté au design moderne des modèles Volkswagen. Il s\'ouvre d\'un côté et il est disponible en Noir mat.',NULL,NULL,NULL,'fr_FR'),(2280,2280,'Prétraitrement 500ml','pretraitrement-500-ml-000054780a','Anéantisseur de marques odorantes 500ml pour éliminer les marquages de territoire des martres.\n Les martres délimitent leur territoire. L\'anéantisseur spécialement développé pour éliminer les marques odorantes est indispensable comme prétraitement avant d\'appliquer des mesures de lutte efficaces contre les martres. Le fait de renoncer à cette précaution pourrait encourager la martre à défendre son territoire.',NULL,NULL,NULL,'fr_FR'),(2281,2281,'Kit Entretien Hiver (Antigel, Dégivrant, Entr. caoutchouc, Gratte givre)','kit-entretien-hiver-antigel-degivrant-entr-caoutchouc-gratte-givre-000096352l','Kit de produit d’entretien Hiver Antigel , dégivrant, entretien du caoutchouc, gratte-givre\nBon à savoir : Il existe une gamme complète de produits d’entretien pour votre Volkswagen. Ces derniers sont parfaitement adaptés à votre véhicule et répondent aux normes de qualité Volkswagen.\nContenu de la livraison : Antigel (500 ml), dégivrant (500 ml), entretien du caoutchouc (75 ml) et gratte-givre',NULL,NULL,NULL,'fr_FR'),(2282,2282,'Dégivrant 500 ml','degivrant-500-ml-000096322f','Dégivrant 500 ml\nNe craignez plus d’avoir froid aux mains ! Le dégivrant d\'origine Volkswagen permet de dégivrer les vitres en quelques secondes seulement. En plus, ce produit empêche qu\'une nouvelle couche de givre ne se forme trop rapidement, garantissant ainsi une parfaite visibilité sans risque d\'éblouissement. Par ailleurs, il convient également à l’intérieur des vitres.',NULL,NULL,NULL,'fr_FR'),(2283,2283,'Gratte-givre avec balai à neige','gratte-givre-avec-balai-a-neige-000096010a','Grattoir à glace avec balai à neige\nGratte-givre avec balai à neige, longueur : 40 cm; gratte-givre en polystyrène extrêmement résistant, de grande qualité, poignée et soies bleues',NULL,NULL,NULL,'fr_FR'),(2284,2284,'Câble de charge USB de type A vers Apple Lightning / USB de type C / micro','cable-de-charge-usb-de-type-a-vers-apple-lightning-usb-de-type-c-micro-5h0087703f','Câble de charge USB de type A vers Apple Lightning / USB de type C / micro USB, avec éclairage, collection Volkswagen\n- Le câble s\'allume et visualise le processus de recharge\n- Pour des sources de courant avec port USB de type A\n- Pour les équipements terminaux avec port Lightning (Apple), micro (Android) et USB de type C (Android)',NULL,NULL,NULL,'fr_FR'),(2285,2285,'Tapis de coffre rigide ID.5','tapis-de-coffre-rigide-id-5-11e061161','Le tapis de coffre rigide à bagages d’origine Volkswagen, pratique et solide, protège le coffre à bagages de la saleté et empêche le chargement de glisser. Ce fond en plastique parfaitement adapté est en outre lavable. Le rebord d’env. 4 cm sur le pourtour empêche les liquides de couler sur le plancher du véhicule. Avec monogramme du véhicule. Fond de coffre pour véhicules avec plancher de chargement 