sation sous la surveillance directe d\'un adulte                                                                                                                                                                                                           \nAttention : Ce jouet n\'offre aucune protection                                                                                                                                                                                                                             \nAttention : Ne pas utiliser sur la route                                                                                                                                                                                                                                   \nAttention : À utiliser avec un équipement de protection approprié',NULL,NULL,NULL,'fr_FR'),(2456,2456,'Album à colorier','album-a-colorier-000087703mj','Album à colorier de 24 pages,\n Avec 48 motifs pour enfants Volkswagen et 6 crayons de couleur\n Matière : Papier\n Collection produits publicitaires\n Ne convient pas aux enfants de moins de 3 ans.',NULL,NULL,NULL,'fr_FR'),(2457,2457,'Carnet bloc-notes','carnet-bloc-notes-000087216ah','Carnet de notes format A5, couverture cartonnée bleu foncé\n Avec logo Volkswagen vernis UV ton sur ton\n Pages à carreaux. Avec ruban de fermeture bleu clair et marquepage.\n Contenu : 96 feuilles  192 pages',NULL,NULL,NULL,'fr_FR'),(2458,2458,'Carnet bloc-notes','carnet-bloc-notes-11g087216','Carnet A5 corail\n Couverture rigide avec monogramme « ID. » gaufré\n Pages à carreaux\n Contenu : 96 feuilles  192 pages',NULL,NULL,NULL,'fr_FR'),(2459,2459,'Tasse','tasse-000069601bq','Tasse à café avec logo Volkswagen',NULL,NULL,NULL,'fr_FR'),(2460,2460,'Tasse','tasse-000069601br','Tasse à café avec logo VW gravé\nLavable en lavevaisselle.',NULL,NULL,NULL,'fr_FR'),(2461,2461,'Stylo à bille','stylo-a-bille-11g087210','Stylo à bille blanc avec impression du monogramme ID. sur le clip',NULL,NULL,NULL,'fr_FR'),(2462,2462,'Etui à cartes bancaires et de visite','etui-a-cartes-bancaires-et-de-visite-000087403d','Étui portecartes 6 poches et gravure Volkswagen\n  Avec bloqueur antiRFID pour protéger contre la lecture de cartes\n en acier inoxydable brossé et angles arrondis',NULL,NULL,NULL,'fr_FR'),(2463,2463,'Tapis de souris','tapis-de-souris-000087703ms','Tapis de souris avec logo Volkswagen\n Thermosoudé FoamtecHF\n Avec bords ergonomiques\n Dessus Speedtop 0,3 mm, dessous Slidestop mousse super adhérente d’env. 1,2 mm\n Collection de produits publicitaires',NULL,NULL,NULL,'fr_FR'),(2464,2464,'Thermos','thermos-000069604s','Gobelet isotherme en inox\n Mat, double paroi, isotherme\n Volume 0,4 litre',NULL,NULL,NULL,'fr_FR'),(2465,2465,'Décapsuleur','decapsuleur-000087703ltjka','Décapsuleur avec fonction « poussoir »',NULL,NULL,NULL,'fr_FR'),(2466,2466,'Briquet','briquet-000087016l','Briquet Zippo, chrome brossé',NULL,NULL,NULL,'fr_FR'),(2467,2467,'Haut-parleur Bluetooth®','haut-parleur-bluetooth-11g087621','Hautparleurs Bluteooth en bleu moyen\n Compatible avec le True Wireless Stereo (TWS) : Connectez 2 hautparleurs et écoutez de la musique en stéréo\n Rechargeable par câble USB ou sans fil (Qi)\n Protection contre la poussière et les projections d’eau (IP55)\n 65 % plastique et 35 % fibres de paille de blé\n Durée de fonctionnement jusqu’à 25 heures (temps de recharge de 3 à 4 heures)\n Câble USB inclus',NULL,NULL,NULL,'fr_FR'),(2468,2468,'Écouteurs Bluetooth','ecouteurs-bluetooth-11g087626','Écouteurs Bluetooth en bleu moyen\n Rechargeables par câble USB ou sans fil (Qi)\n Avec 3 tailles d’embouts d’oreille\n Protection contre la saleté et l’eau (IP44)\n Jusqu’à 20 heures d’autonomie (temps de recharge env. 1,5 h)\n Câble USB inclus',NULL,NULL,NULL,'fr_FR'),(2469,2469,'Chargeur à induction','chargeur-a-induction-5hv087625a','Chargeur à induction revêtu en tissu, à carreaux GTI\n Pour recharger sans fil divers terminaux\n Puissance de recharge jusqu’à 10 W (5 V/1 A, 9 V/1,1 A)\n Standard Qi\n Possibilité de le raccorder à des chargeurs USB standard\n Câbles USB inclus (1,5 m)',NULL,NULL,NULL,'fr_FR'),(2470,2470,'Écouteurs Bluetooth','ecouteurs-bluetooth-5hv087626a','Écouteurs sans fil True Wireless\n Bluetooth 5.0\n Compatibles avec tous les smartphones courants\n Fonction mainslibres\n Autonomie jusqu’à 3 heures\n Avec monogramme GTI sur les écouteurs et la boîte de rangement',NULL,NULL,NULL,'fr_FR'),(2471,2471,'Serviette de bain','serviette-de-bain-5h0084500','serviette ronde originale, en éponge en coton de haute qualité\n à la fois très douce et de qualité épaisse\n absorbante\n pratique et à usages multiples comme couverture de piquenique, tapis de jeu, serviette de plage ou de bain\n Logo Volkswagen tissé sur toute la surface\n étiquette jaune avec monogramme Volkswagen sur le bord\n Ruban de suspension',NULL,NULL,NULL,'fr_FR'),(2472,2472,'Voiture jouet','voiture-jouet-1h4087511a','Voiture jouet en bois\n Peinte en bleu, imprimé au design Volkswagen\n Roues mobiles',NULL,NULL,NULL,'fr_FR'),(2473,2473,'Set de pailles','set-de-pailles-7t0069640a','Set de pailles en acier inoxydable\n Composé de 2 pailles droites et 2 courbées ainsi que d’une brosse de nettoyage\n Avec logo Volkswagen gravé sur les pailles\n Écologique et réutilisable avec sachet en coton',NULL,NULL,NULL,'fr_FR'),(2474,2474,'Plaid Coccinelle','plaid-coccinelle-1h4084503','Couverture douce\n En micropolaire\n Avec motif Coccinelle sur le dessus\n Dessous uni blanc crème\n Bordure ornée de points de surjet décoratifs',NULL,NULL,NULL,'fr_FR'),(2475,2475,'Porte-clés','porte-cles-1h4087013','Porteclés avec Golf 1 GTI noire\n Miniature fidèle à l’original à l’échelle de 1:87\n De la société Schuco\n Avec roues mobiles et intérieur visible\n Monogramme Volkswagen gravé sur le porteclés\n Dans un emballage cadeau personnalisé',NULL,NULL,NULL,'fr_FR'),(2476,2476,'Thermos','thermos-11g069604','Bouteille isotherme double paroi en inox, 500 ml\n Surface mate\n Étanche et sans BPA (bisphénol A)\n Isolation par le vide\n Garde les liquides froids pendant 12 heures et les liquides chauds pendant 8 heures',NULL,NULL,NULL,'fr_FR'),(2477,2477,'Thermos','thermos-11g069604a','Bouteille isotherme double paroi en inox, 1 000 ml\n Surface mate\n Étanche et sans BPA (bisphénol A)\n Isolation par le vide\n Garde les liquides froids pendant 12 heures et les liquides chauds pendant 8 heures',NULL,NULL,NULL,'fr_FR'),(2478,2478,'Tasse','tasse-5hv069601a','Gobelet en porcelaine GTI noir mat, avec motif du monogramme GTI\nLes coordonnées sous le monogramme GTI décrivent le lieu où la carrosserie et le moteur sont assemblés. Dans la ligne inférieure se trouve également la mention « Made by Volkswagen »\n Avec une capacité de 0,36 l',NULL,NULL,NULL,'fr_FR'),(2479,2479,'Gobelet isotherme','gobelet-isotherme-5hv069604','Ce gobelet isotherme GTI designed by Volkswagen Design présente une surface noir mat\n Les coordonnées sous le monogramme GTI décrivent le lieu où la carrosserie et le moteur sont assemblés. Dans la ligne inférieure se trouve également la mention « Made by Volkswagen »\n La double paroi du mug permet une isolation par le vide et ainsi de maintenir le contenu du mug au chaud ou au froid.\n Après usage, il peut rester un peu de liquide dans le couvercle du mug isotherme.\n Ce liquide peut s’écouler lorsque le mug isotherme est incliné ; nous vous recommandons donc de boire le reste du liquide avec le couvercle fermé.',NULL,NULL,NULL,'fr_FR'),(2480,2480,'Coussin','coussin-5hv084508','Coussin en design GTI\n Devant : Garniture de siège GTI d\'origine à carreaux, au dos : Garniture de siège GTI d\'origine en noir\n avec logo GTI cousu\n Composée d\'une housse de coussin avec fermeture éclair et garnissage en ouate polyester\n Housse et garniture lavables',NULL,NULL,NULL,'fr_FR'),(2481,2481,'Tasse','tasse-5h6069601','Gobelet en porcelaine\n Imprimé noir sur le contour, logo blanc évidé\n Anse blanche\nCapacité 0,35l\n Diamètre partie supérieur 93 mm\n Lavable en lavevaisselle\n Origine UE',NULL,NULL,NULL,'fr_FR'),(2482,2482,'Thermos','thermos-5h0069604','Le mug isotherme a une surface bleue et présente une gravure laser du logo Volkswagen.\n Le couvercle est argenté et l’anneau est noir.\n La double paroi du mug permet une isolation par le vide et ainsi de maintenir le contenu du mug au chaud ou au froid.\n Après usage, il peut rester un peu de liquide dans le couvercle du mug isotherme.\n Ce liquide peut s’écouler lorsque le mug isotherme est incliné ; nous vous recommandons donc de boire le reste du liquide avec le couvercle fermé.',NULL,NULL,NULL,'fr_FR'),(2483,2483,'Montre Femme','montre-femme-11g050801','- Montre fabriquée à partir de matériaux naturels durables\n- Unisexe, diamètre 40 mm\n- Anneau de boîtier en bois naturel (bambou)\n- Boîtier métallique plaqué or rose (alliage sans nickel)\n- Mouvement à l’énergie solaire\n- Mouvement japonais de qualité\n- Affichage : Heure/minute/seconde\n- Bracelet vegan en cuir de pomme Appleskin TM tanné avec des substances végétales\n- Cadran imprimé avec encre durable à base d’eau\n- Logo Volkswagen ID. sur le cadran\n- Logo Volkswagen sur le fond\n- Boîtier métallique étanche 3 ATM',NULL,NULL,NULL,'fr_FR'),(2484,2484,'Puzzle','puzzle-1h9087528a','Puzzle en bois à encastrer avec 7 motifs Volkswagen.\nÉléments du puzzle imprimés avec poignée en bois. \nRéalisé par le fabricant renommé Gollnest & Kiesel.',NULL,NULL,NULL,'fr_FR'),(2485,2485,'Porte-clés','porte-cles-1k6087010','- Porte-clés pouvant servir pour débloquer un chariot libre-service\n- Logo Volkswagen gravé des deux côtés\n- En acier inoxydable',NULL,NULL,NULL,'fr_FR'),(2486,2486,'Porte-clés','porte-cles-5hv087013','Porte-clés en PVC souple\n- Recto avec motif 2D « Coordonnées GTI »\n- Verso mat\n- Le logement de clé est un demi-nid d’abeille avec trois petits anneaux fendus',NULL,NULL,NULL,'fr_FR'),(2487,2487,'Porte-clés','porte-cles-000087010bq','Porte-clés en émail avec logo Volkswagen\nØ d’env. 37 mm',NULL,NULL,NULL,'fr_FR'),(2488,2488,'Porte-clés','porte-cles-000087010caypn','- Porte-clés métallique de haute qualité avec cuir PU\n- Logo ID.3 gravé\n- Avec 2 anneaux porte-clés',NULL,NULL,NULL,'fr_FR'),(2489,2489,'Porte-clés','porte-cles-000087010cbypn','- Porte-clés métallique de haute qualité avec cuir PU\n- Logo ID.4 gravé\n- Avec 2 anneaux porte-clés',NULL,NULL,NULL,'fr_FR'),(2490,2490,'Porte-clés','porte-cles-000087010ceypn','- Porte-clés métallique de haute qualité avec cuir PU\n- Logo ID.5 gravé\n- Avec 2 anneaux porte-clés',NULL,NULL,NULL,'fr_FR'),(2491,2491,'Porte-clés','porte-cles-000087010cfypn','- Porte-clés métallique de haute qualité avec cuir PU\n- Logo GTX gravé\n- Avec 2 anneaux porte-clés',NULL,NULL,NULL,'fr_FR'),(2492,2492,'Porte-clés','porte-cles-000087010cgypn','- Porte-clés métallique de haute qualité avec cuir PU\n- Logo Taigo gravé\n- Avec 2 anneaux porte-clés',NULL,NULL,NULL,'fr_FR'),(2493,2493,'Porte-clés','porte-cles-000087011k','- Porte-clés en cuir avec clip métallique',NULL,NULL,NULL,'fr_FR'),(2494,2494,'Porte-clés','porte-cles-000087010bmypn','- Porte-clés métallique de haute qualité avec cuir PU\n- avec logo Volkswagen gravé',NULL,NULL,NULL,'fr_FR'),(2495,2495,'Barre de toit','barre-de-toit-1t3071126a','Barre de toit Rainure en T, argent, fixation par vis\nSupports de base d\'origine Volkswagen ID. Buzz\n- Conception sur mesure et spécifique au véhicule\n- Prémonté et prêt au montage\n- Sécurité antivol verrouillable\n- Profil aérodynamique pour minimiser les bruits de conduite\n- Supports caoutchoutés pour protéger la peinture et le véhicule\n- City Crash Plus testé selon les directives strictes de Volkswagen\n- Capacité de charge des supports 95 kg\n- Contenu : deux supports de base, avec clé dynamométrique et notice de montage',NULL,NULL,NULL,'fr_FR'),(2496,2496,'Porte-clés avec LED, rechargeable (USB)','porte-cles-avec-led-rechargeable-usb-1t3087010','Porte-clés avec LED, rechargeable (USB)\n- Lampe de poche servant de porte-clés\n- Forme reprenant celle du bus électrique\n- Avec LED (blanche) et câble de charge\n- Rechargeable via USB-C (5 V)\n- Prière de recharger la batterie (batterie lithium-polymère 60 mAh) tous les 6 mois\n- En métal coulé, chromé\n- Avec affichage LED de l’état de charge (rouge : charge en cours, vert : charge terminée)',NULL,NULL,NULL,'fr_FR');
